import { createIcon } from "../icon/createIcon";

export const MenuIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="MenuIcon">
    <path d="M12 9v2H0V9h12zm0-4v2H0V5h12zm0-4v2H0V1h12z" />
  </svg>,
  "Menu",
  "menu"
);
